        </a>
      </header> */}
      <main>
      <Switch>
          <Route exact path="/" component={HomeScreen}/>
          <Route exact path="/about" component={AboutPage}/>
          <Route exact path="/cart" component={CartScreen}/>

        </Switch>
      </main>
    </div>
  );
}

export default App;
